import React from 'react'
import Container from 'react-bootstrap/Container';

function home() {
  return (

      <Container>
        <div class="d-flex justify-content-between mt-5"> 
        <h1 className="text-secondary">Top 10 Songs</h1>
        <button className="btn btn-secondary">+ Add Song</button>
        </div>

      </Container>


  )
}

export default home
